import React, { useEffect, useState } from 'react';
import { Table, TableBody, TableCell, TableHead, TableRow, Typography } from '@mui/material';
import ABTestService from '../../services/api';
import { CampaignResultResponse, Variant } from '../../services/types';

const CampaignResults: React.FC = () => {
  const [resultData, setResultData] = useState<CampaignResultResponse[]>([]);

  useEffect(() => {
    const fetchResults = async () => {
      try {
        const response = await ABTestService.getAllCampaignResults();
        if (Array.isArray(response)) {
          setResultData(response); // Use response as it is
        } else {
          setResultData([response]); // Wrap response in an array
        }
      } catch (error) {
        console.error('Error fetching campaign results:', error);
      }
    };

    fetchResults();
    const interval = setInterval(fetchResults, 15000);
    return () => clearInterval(interval);
  }, []);

  const renderTableHeader = () => {
    return (
      <TableHead>
        <TableRow>
          <TableCell>Campaign Name</TableCell>
          <TableCell>Date Created</TableCell>
          <TableCell>Analysis Time</TableCell>
          <TableCell>Status</TableCell>
        </TableRow>
      </TableHead>
    );
  };

  const renderTableBody = () => {
    if (resultData.length === 0) {
      return null;
    }

    return (
      <TableBody>
        {resultData.map((result, index) => (
          <TableRow key={result.campaign_id}>
            <TableCell>{result.campaign_name}</TableCell>
            <TableCell>{result.date_created}</TableCell>
            <TableCell>{result.analysis_time}</TableCell>
            <TableCell>{result.status}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    );
  };

  const renderMetricsTable = (result: CampaignResultResponse) => {
    const { campaign_name, p_value, confidence_interval_lower, confidence_interval_upper, winner, analysis_time, variants, status } = result;

    return (
      <div style={{ marginBottom: '20px' }} key={result.campaign_id}>
        <Typography>Campaign Name: {campaign_name}</Typography>
        <Typography>P-value: {p_value}</Typography>
        <Typography>Confidence Interval: [{confidence_interval_lower}, {confidence_interval_upper}]</Typography>
        <Typography>Winner: {winner}</Typography>
        <Typography>Analysis Time: {analysis_time}</Typography>
        <Typography>Status: {status}</Typography>
        {variants?.length > 0 && (
          <>
            <Typography>Variants:</Typography>
            <Table style={{ width: '100%', marginBottom: '20px' }}>
              <TableHead>
                <TableRow>
                  <TableCell style={{ padding: '10px', border: '1px solid #ccc', backgroundColor: '#f7f7f7', color: '#333', fontWeight: 'bold' }}>Variant</TableCell>
                  <TableCell>Total Views</TableCell>
                  <TableCell>Click Through Rate</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {variants.map((variant) => (
                  <TableRow key={variant.id}>
                    <TableCell>{variant.name}</TableCell>
                    <TableCell>{variant.total_views}</TableCell>
                    <TableCell>{(variant.ctr * 100).toFixed(2)}%</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </>
        )}
      </div>
    );
  };

  return (
    <div>
      <Typography variant="h1">Campaign Results</Typography>
      <Table>
        {renderTableHeader()}
        {renderTableBody()}
      </Table>
      {resultData.length > 0 && renderMetricsTable(resultData[0])}
    </div>
  );
};

export default CampaignResults;
